	room.sendAnnouncement(getTime(scores) + golcontra + lastPlayersTouched[0].name + ", VELOCIDADE : " + ballSpeed.toPrecision(4).toString() + "km/h. " + (team == Team.RED ? "" : ""),null,(team == Team.RED ? 0xFF0000 : 0x1E47EC), Italic);
