struct Matrix{
   explicit Matrix(std::size_t const rows, std::size_t const cols)
      : rows_{rows} , cols_{cols}
   {}
   explicit Matrix(
         std::initializer_list<double> valores, 
         std::size_t const cols) 
      : cols_{cols}
   {
      assert( cols_ > 0);
      assert( valores.size() % cols_ == 0 );
      rows_ = valores.size() / cols_;
      data_.reserve( valores.size() );
      //std::copy(valores.begin(), valores.end()
      //         , std::back_inserter(data_));
      std::ranges::copy(valores, std::back_inserter(data_));
   }
   double& operator[](std::size_t const row
                  , std::size_t const col) {
      assert(row < rows_ && col < cols_);

      return data_[ row*cols_ + col ];
   }
   double operator[](std::size_t const row
                  , std::size_t const col) const {
      assert(row < rows_ && col < cols_);

      return data_[ row*cols_ + col ];
   }
   Matrix operator*(Matrix const& R) const {
      assert( cols_ == R.rows_ );

      Matrix const& L = *this;
      Matrix Res{rows_, R.cols()};
      for(auto r{0uz}; r < rows_; r+=1) {
         for(auto c{0uz}; c < R.cols(); c+=1) {
            for(auto k{0uz}; k < cols_; k+=1) {
               Res[r,c] += L[r,k] * R[k,c];
            }
         }
      }

      return Res;
   }
   Matrix& apply(double (*func)(double)) {
      std::ranges::transform(data_, data_.begin(), func);
      return *this;
   }
   static double sign(double x) {
      if (x > 0.0) return 1.0;
      return -1.0;
   }

   double random_double(double const min, double const max) {
      assert(min < max);
      static std::random_device rd{};
      static std::mt19937 gen{ rd() };
      std::uniform_real_distribution<> dist(min, max);

      return dist( gen );
   }
   void init_randomly(double const min, double const max) {
      assert(min < max);
      for(auto& e : data_) { 
         e = random_double(min, max); 
      }
   }


   Matrix operator!=(Matrix const& R) const {
      auto& L = *this;
      assert(L.cols() == R.cols() && L.rows() == R.rows());
      Matrix res{L.rows(), L.cols()};

      for(auto r{0uz}; r < L.rows(); r += 1 ) {
         for(auto c{0uz}; c < L.cols(); c += 1 ) {
            if ( L[r,c] != R[r,c] )
               res[r,c] = 1.0;
         }
      }

      return res;
   }

   constexpr double sumcol(std::size_t const col) const {
      assert(col < cols_);
      auto& M = *this;
      double res{};
      for(auto r{0uz}; r < rows_; r += 1 ) {
         res += M[r,col];
      }
      return res;
   }

   constexpr std::size_t cols() const noexcept { return cols_; }
   constexpr std::size_t rows() const noexcept { return rows_; }
private:
   std::size_t rows_{};
   std::size_t cols_{};
   std::vector<double> data_ = std::vector<double>(rows_ * cols_);
};

